import React from 'react';

export default function AboutMe() {
    return(
        <>
        <div className="container">
            <div className="row">
                <div className="col-sm-12">
                    <h1>About Me</h1>
                    <p>My name is Alex. I am a student at the King's College London. I am currently studying.</p>
                </div>
            </div>
        </div>
        </>
    )
}
